import {useState} from 'react';


function App() {
  const [form, setForm] = useState({
    name: '',
  });
  const handleChange = (e) => {
    setForm({
      ...form,
      [e.target.name]: e.target.value,
    });
  };



  return (
    <form>
      <input 
        name='name' 
        placeholder='Name' 
        value={form.name}
        onChange={handleChange}
        />
    </form>
  );
}

export default App;
